#define ROOT_RELEASE_TIME "22:20:07"
#define ROOT_SVN_REVISION 43511
#define ROOT_SVN_BRANCH "branches/v5-32-00-patches"
#define ROOT_VERSION_CODE 335874
#define ROOT_VERSION(a,b,c) (((a) << 16) + ((b) << 8) + (c))

#endif
